import React from 'react';
import Menu from '../../components/Menu';
import { Breadcrumb, Container } from 'react-bootstrap';
import Titulo from '../../components/Titulo';
import TabelaHortalicas from '../../components/TabelaHortalicas';
import { Divider, Button } from 'antd';
import { DeleteOutlined, EditOutlined } from '@ant-design/icons';
const { Item } = Breadcrumb;

function Hortalicas() {

    const dataSource = [
        {
            key: '1',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00'
        },
        {
            key: '2',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00',
        },
        {
            key: '3',
            nome: 'Alface',
            categoria: 'Folhas',
            classificacao: '5',
            valor: '2,00',
        },
    ];

    const acoes = {
        title: 'Ações',
        dataIndex: 'acoes',
        key:'acoes',
        render: (text,record) => dataSource.length >= 1 ? (
            <span>
                <Button
                    type='primary'
                    style={{ marginLeft: '2px' }}
                    icon={<EditOutlined />}
                    onClick={editar}
                />
                <Button
                    type='primary'
                    style={{ marginLeft: '2px' }}
                    danger
                    icon={<DeleteOutlined />}
                />
            </span>
        ):null,
    };

    return (
        <div>
            <Menu />
            <Breadcrumb>
                <Item href="/">Principal</Item>
                <Item active>Hortaliças</Item>
            </Breadcrumb>
            <Container>
                <Titulo name='Hortaliças' />
                <Divider />
                <TabelaHortalicas dataSource={dataSource} acoes={acoes}/>
                <Divider />
                <Button type='primary' href='/cadastroHortalicas'>Cadastrar</Button>
            </Container>
        </div>
    );
}

export default Hortalicas;
